import imgLit from '../images/litaya.jpg'
import imgSteer from '../images/Уличная.jpg'
import imgTabl from '../images/Настольные.jpg'
import imgSnow from '../images/Заснежные.jpg'
import imgComb from '../images/Комбинированные.jpg'
import { Box, Card, Typography } from '@mui/material';
import CardForm from './CardForm';
import '../styles/popular/pupular.css';

export default function Popular(props) {
  return (
    <>
      <Box id='popular' className='popular'></Box>
      <h1 className='popular__title'>Популярные разделы</h1>
      <Box display={'flex'} marginTop={'9vh'}>
        <CardForm
          title='Литые Елки'
          subtitle='Gradients are CSS elements of the image data type that show a transition between two or more colors. These transitions are shown as either linear or radial.
'         image={imgLit}
        />
        <CardForm
          title='Уличные Елки'
          subtitle='Gradients are CSS elements of the image data type that show a transition between two or more colors. These transitions are shown as either linear or radial.
'         image={imgSteer}
        />
        <CardForm
          title='Chrismas Tree From Bellarys'
          subtitle='Gradients are CSS elements of the image data type that show a transition between two or more colors. These transitions are shown as either linear or radial.
'         image={imgTabl}
        />
        <CardForm
          title='Chrismas Tree From Bellarys'
          subtitle='Gradients are CSS elements of the image data type that show a transition between two or more colors. These transitions are shown as either linear or radial.
'         image={imgSnow}
        />
        <CardForm
          title='Chrismas Tree From Bellarys'
          subtitle='Gradients are CSS elements of the image data type that show a transition between two or more colors. These transitions are shown as either linear or radial.
'         image={imgComb}
        />
      </Box>
    </>
  );
}
